import { Link, useNavigate } from 'react-router-dom';

import './start.css';

import { Title, Button } from '../../components';
import '../../Styles.css'

function Start() {
  return (
    <div className="App">
      <div className='start'>
        <Title/>
        <Button>Singleplayer</Button>

        <Button onClick={useNavigate({pathname:"/config"})}>Multiplayer</Button>
      </div>
    </div>
  );
}

export default Start;
